import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Login.css';

import elephant from '../Assets/Untitled_Artwork15.PNG';
import email from '../Assets/email.png';
import contactPopup from '../PopUps/Contactpopup';

const Login = () => {
    const navigate = useNavigate();

    const handleLogin = () => {
        // Perform login logic here (dummy logic for now)
        // This will be used to check if valid within an SQL database, blah blah
        navigate('/home');
    };

    return (
        <div className='container'>
            <div className = 'blob'>
                <svg viewBox="0 0 200 200" xmlns="http://www.w3.org/2000/svg">
                    <path fill="#FEE5FF" d="M51.3,-55.4C63.1,-39.6,66.9,-19.8,65.2,-1.7C63.5,16.4,56.4,32.9,44.6,43.5C32.9,54.1,16.4,59,-0.8,59.8C-18.1,60.6,-36.2,57.5,-48.1,46.8C-59.9,36.2,-65.6,18.1,-65,0.5C-64.5,-17,-57.8,-34,-45.9,-49.9C-34,-65.7,-17,-80.4,1.4,-81.8C19.8,-83.2,39.6,-71.3,51.3,-55.4Z" transform="translate(100 100)" />
                </svg>
            </div>
            <div className='header'>

                <div className="elephant">

                    <img src={elephant} alt="Elephant" className="elephantimg"/>
                </div>
                <div className="underline"></div>
            </div>
            <div className="inputs">
                <div className="inputBox">
                    <input type="email" placeholder='Email'/>
                </div>
                <div className="inputBox">
                    <input type="password" placeholder='Password'/>
                </div>
            </div>
            <div className="submit-container">
                <div className="submit" onClick={handleLogin}>
                    Login
                </div>
            </div>
        </div>
    );
}

export default Login;
